description:
Verenigde Staten
Avontuur / Drama
127 minuten

goed

met Kristen Stewart, Chris Hemsworth en Charlize Theron

Snow White and the Huntsman hervormt het klassieke sprookje door meer achtergrondverhaal te geven aan Eric (Chris Hemsworth), de 
jager die door Ravenna wordt ingehuurd om Sneeuwwitje (Kristen Stewart) te vermoorden. Uiteindelijk weigert hij dit door te 
zetten en besluit hij haar mentor te worden.
